import axios from "axios";
import { GET_DOGS } from "./types";

export const getDogs = () => {
  return async function (dispatch) {
    const dogs = await axios.get("http://localhost:3001/dogs").data;

    dispatch({ type: GET_DOGS, payload: dogs });
  };
};
